import React, { Component } from "react";
import { Text, StyleSheet, Dimensions, Button } from "react-native";

export default class ReusableBtn extends Component {
  render() {
    return <Button styles={styles.reusableButton} />;
  }
}

const styles = StyleSheet.create({
  reusableButton: {
    maxWidth: Dimensions.get("window").width * 0.8
  }
});
